class Solution(object):
    def slidingPuzzle(self, board):
        """
        :type board: List[List[int]]
        :rtype: int
        """

        def swap(board, i, j):
            board[i][j], board[i][j + 1] = board[i][j + 1], board[i][j]
            return board

        def isSolved(board):
            return board == [[1,2,3],[4,5,0]]

        def getNextStates(board):
            nextStates = []
            i, j = board.index(0)
            if i == 0:
                nextStates.append(swap(board, i, j + 1))
                nextStates.append(swap(board, i, j - 1))
            elif i == 1:
                nextStates.append(swap(board, i, j + 1))
                nextStates.append(swap(board, i, j - 1))
                nextStates.append(swap(board, i, j + 2))
            elif i == 2:
                nextStates.append(swap(board, i, j + 1))
                nextStates.append(swap(board, i, j - 1))
                nextStates.append(swap(board, i, j + 2))
            elif i == 3:
                nextStates.append(swap(board, i, j + 1))
                nextStates.append(swap(board, i, j - 1))
                nextStates.append(swap(board, i, j + 2))
                nextStates.append(swap(board, i, j + 3))
            elif i == 4:
                nextStates.append(swap(board, i, j + 1))
                nextStates.append(swap(board, i, j - 1))
                nextStates.append(swap(board, i, j + 2))
                nextStates.append(swap(board, i, j + 3))
                nextStates.append(swap(board, i, j + 4))
            return nextStates

        def bfs(board):
            queue = [(board, 0)]
            visited = set()
            while queue:
                board, moves = queue.pop(0)
                if isSolved(board):
                    return moves
                for nextBoard in getNextStates(board):
                    if tuple(nextBoard) not in visited:
                        visited.add(tuple(nextBoard))
                        queue.append((nextBoard, moves + 1))
            return -1

        return bfs(board)

